أسأل الله عز وجل
 أن يغفر زلاتنا ويقضي حاجاتنا ويرفع منزلتنا ويثبت قلوبنا ويسهل أمورنا ويبارك بأهلنا وأعمارنا ويصلح ذات بيننا { اللهم امين }    

١٥ رمضان 🌙

قال رسول الله ﷺ :-

{ أكثروا من الصّلاة عليَّ ليلة الجُمعة ويوم الجُمعة         فإن صلاتكُم معروضةٌ عليّ }

          اللَّهُم صلِ وسلِّمْ وبارك على نبينا مُحمّد https://t.co/RhzZHlWRpB
